    /**
     * @throws ValidationException
     */
    public function testGetAllOperations(): void
    {
        if ($this->websocketMock) {
            $this->websocketMock
                ->expects($this->once())
                ->method('send')
                ->withConsecutive(
                    [$this->callback(function(BaseRequest $req) { return $req->setId(1)->toJson() === '{"jsonrpc":"2.0","id":1,"method":"call","params":[5,"get_message_objects",[null,"1.2.27",1000]]}'; })]
                )
                ->will($this->onConsecutiveCalls(
                    GetMessageObjects::responseToModel(new BaseResponse('{"id":1,"result":[{"id":"2.18.7","created":"2019-03-30T15:14:15","sender":"1.2.19","sender_pubkey":"DCT7SgGZgKt6KWMJMiHmaMxw99mkfqMGLAywRfbPNKB4GV7tSr3BK","receivers_data":[{"receiver":"1.2.27","receiver_pubkey":"DCT6TjLhr8uESvgtxrbWuXNAN3vcqzBMw5eyEup3PMiD2gnVxeuTb","nonce":"472388164175706498","data":"1f01633334e30adc227838b12d9ec8e9"}],"text":""},{"id":"2.18.8","created":"2019-03-30T15:16:35","sender":"1.2.19","sender_pubkey":"DCT7SgGZgKt6KWMJMiHmaMxw99mkfqMGLAywRfbPNKB4GV7tSr3BK","receivers_data":[{"receiver":"1.2.27","receiver_pubkey":"DCT6TjLhr8uESvgtxrbWuXNAN3vcqzBMw5eyEup3PMiD2gnVxeuTb","nonce":"10967938073573169003","data":"249103fffa7526a5deb2c1a9083fae5d"}],"text":""},{"id":"2.18.9","created":"2019-03-30T15:17:00","sender":"1.2.19","sender_pubkey":"DCT7SgGZgKt6KWMJMiHmaMxw99mkfqMGLAywRfbPNKB4GV7tSr3BK","receivers_data":[{"receiver":"1.2.27","receiver_pubkey":"DCT6TjLhr8uESvgtxrbWuXNAN3vcqzBMw5eyEup3PMiD2gnVxeuTb","nonce":"8073248061168307137","data":"d7a170537ae3a605d406dbabafde4528"}],"text":""}]}'))
                ));
        }

        $messageResponses = $this->sdk->getMessagingApi()->getAllOperations(null, new ChainObject(DCoreSDKTest::ACCOUNT_ID_1));
